import React from "react";
import { useEffect, useState } from "react";

export default function UseFetch() {
  const [data, setData] = useState({});

  const url = "https://api.data.gov.sg/v1/environment/psi";

  // React.useEffect(() => {
  //   const fetchData = async () => {
  //       const res = await fetch(url);
  //       const json = await res.json();
  //       setResponse(json.items[0].readings);

  //       return (
  //         <table>
  //           <thead>
  //             <tr>
  //                 { Object.keys(response).forEach((key) => <th>{key}</th> )}
  //             </tr>
  //           </thead>
  //         </table>
  //       )
  //   };
  //   fetchData();
  // }, []);
  const [loading, setLoading] = useState(true)
  const [error, setError] = useState()

  const headers = []
  const rows = []


  useEffect(() => {
    fetch(url)
    .then((json) => json.json())
    .then((res) => {
      // setData(res.items[0].readings)
      Object.keys(res.items[0].readings).forEach((key) => headers.push(key))
      Object.values(res.items[0].readings).forEach((key) => rows.push(key))
      setLoading(false)
    }).catch(error => setError(error))
  }, []);

  if (loading) return <div>loading</div>

  if (error) return <div>error</div>

  return (
    <div>
      <table>
        <thead>
          <tr>
          {(() => {
          const header = [];

          for (let i = 0; i <= headers.length; i++) {
            header.push(<th>{headers[i]}</th>);
          }

          return header;
        })()}
          </tr>
        </thead>
      </table>
    </div>
  )  
}
